      BIO_csi_DW.PRz_tmp = ((Hw6 - Hw1) * BIO_csi_B.Step - -1.9966 *
                            BIO_csi_DW.PRz_states[0]) - 0.998 *
        BIO_csi_DW.PRz_states[1];

